const axios = require("axios");

axios({
    "method":"GET",
    "url":"https://siddiq-such-flight-v1.p.rapidapi.com/search",
    "headers":{
    "content-type":"application/octet-stream",
    "x-rapidapi-host":"siddiq-such-flight-v1.p.rapidapi.com",
    "x-rapidapi-key":"c573d899fbmsh7f790eccbfa07a7p17edf7jsnf6b3cf11be53",
    "useQueryString":true
    },"params":{
    "return-date":"2015-04-07",
    "to":"SDQ",
    "depart-date":"2021-03-31",
    "from":"JFK"
    }
    })
    .then((response) => {
        console.log(response)
    })
    .catch((error) => {
        console.log(error);
    });
